(1, 1, 'new_sale', '<p>Dear {contact_name},</p>\r\n<p>Your invoice number is {invoice_number}<br />Total amount: {total_amount}<br />Paid amount: {received_amount}</p>\r\n<p>Thank you for shopping with us.</p>\r\n<p>&nbsp;</p>', 'Dear {contact_name}, Thank you for shopping with us. {business_name}', 'Dear {contact_name},\r\n\r\nYour invoice number is {invoice_number}\r\nTotal amount: {total_amount}\r\nPaid amount: {received_amount}\r\n\r\nThank you for shopping with us.', 'Thank you from {business_name}', NULL, NULL, 0, 0, 1, '2022-01-04 05:50:15', '2024-10-12 13:36:53'),
(2, 1, 'payment_received', '<p>Dear {contact_name},</p>\r\n<p>We have received a payment of {received_amount}</p>\r\n<p>{business_logo}</p>', 'Dear {contact_name}, We have received a payment of {received_amount}. {business_name}', 'Dear {contact_name},\r\n\r\nWe have received a payment of {received_amount}\r\n\r\n{business_logo}', 'Payment Received, from {business_name}', NULL, NULL, 0, 0, 0, '2022-01-04 05:50:15', '2024-10-12 13:33:30'),
