(2, 'ELFAII BASIC', 'The Elfaiipos Basic Plan offers essential features at an affordable price, perfect for beginners seeking efficient tools and support.', 1, 2, 0, 0, 0, 0, 0, 0, 'years', 1, 30, '999.0000', '', 1, 1, 1, 0, NULL, 0, 1, 1, NULL, NULL, NULL, '2024-10-12 19:07:16', '2024-10-18 14:16:13'),
(3, 'ELFAII PRO', 'The Elfaiipos Pro Plan provides advanced features, enhanced support, and greater customization options, ideal for professionals needing robust performance and flexibility.', 1, 10, 0, 0, 0, 0, 0, 0, 'years', 1, 60, '1499.0000', '{\"productcatalogue_module\":\"1\",\"repair_module\":\"1\"}', 1, 1, 1, 1, NULL, 0, 1, 0, '', '', NULL, '2024-10-12 19:15:22', '2024-10-16 05:00:17'),
(4, 'ELFAII PREMIUM', 'The Elfaiipos Premium Plan delivers the highest level of features, priority support, and exclusive tools, designed for organizations requiring maximum capabilities.', 2, 20, 0, 0, 0, 0, 0, 0, 'years', 1, 90, '2999.0000', '{\"essentials_module\":\"1\",\"productcatalogue_module\":\"1\",\"repair_module\":\"1\"}', 1, 1, 1, 0, NULL, 0, 1, 0, '', '', NULL, '2024-10-12 19:21:25', '2024-10-16 04:59:12'),
(5, 'ELFAII STANDARD', 'The Standard plan subscription usually includes enhanced features, access for multiple users, priority support, and no advertisements for one month.', 2, 5, 0, 0, 0, 0, 0, 0, 'months', 1, 0, '299.0000', '{\"essentials_module\":\"1\",\"productcatalogue_module\":\"1\",\"repair_module\":\"1\",\"woocommerce_module\":\"1\"}', 1, 1, 1, 1, NULL, 0, 1, 0, '', '', NULL, '2024-10-12 22:12:26', '2024-10-16 04:59:45');
